import { Section, Typography, Table } from "@toptal/picasso";

import data from "../../data";

const ContentRight = () => {
  return (
    <Section
      title={
        <Typography variant="heading" size="xlarge">
          Heroes
        </Typography>
      }
      variant="bordered"
    >
      <Table variant="striped">
        <Table.Head>
          <Table.Row>
            <Table.Cell>Name</Table.Cell>
            <Table.Cell>Hero</Table.Cell>
            <Table.Cell>Cape</Table.Cell>
            <Table.Cell>Universe</Table.Cell>
          </Table.Row>
        </Table.Head>
        <Table.Body>
          {data.map((row) => (
            <Table.Row key={row.id}>
              <Table.Cell>{row.name}</Table.Cell>
              <Table.Cell>{row.hero}</Table.Cell>
              <Table.Cell>{row.cape}</Table.Cell>
              <Table.Cell>{row.universe}</Table.Cell>
            </Table.Row>
          ))}
        </Table.Body>
        <Table.Footer>
          <Table.Row>
            <Table.Cell colSpan={3}>Total</Table.Cell>
            <Table.Cell>{data.length}</Table.Cell>
          </Table.Row>
        </Table.Footer>
      </Table>
    </Section>
  );
};

export default ContentRight;
